                let rank = i+1;
                result.push('Логин: ' + string[i].login + ' ' + 'Очки: ' + string[i].score + ' ' + 'Дата: ' + string[i].date + ' ' + 'Место: ' + rank);
            }   
        }
        //console.log(result);
